def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(level, list):
            levels = level
        else:
            levels = [level]

    keys = key if isinstance(key, list) else [key]
    match_axis_length = len(keys) == group_axis.shape[axis]

    groupings = []
    exclusions = []

    for i, (gpr, level) in enumerate(zip(keys, levels)):
        in_axis = True

        if isinstance(gpr, Grouper):
            binner, grouper, obj = gpr._get_grouper(obj, validate=False)
            if gpr.key is None:
                return grouper, [], obj
            else:
                return grouper, {gpr.key}, obj
        elif isinstance(gpr, BaseGrouper):
            return gpr, [], obj

        if is_categorical_dtype(gpr) and len(gpr) != obj.shape[axis]:
            raise ValueError(
                "Length of grouper ({len_gpr}) and axis ({len_axis}) must be the same length".format(
                    len_gpr=len(gpr), len_axis=obj.shape[axis]
                )
            )

        ping = Grouping(
            group_axis,
            gpr,
            obj=obj,
            name=gpr if isinstance(gpr, str) else None,
            level=level,
            sort=sort,
            observed=observed,
            in_axis=in_axis
        )

        groupings.append(ping)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(Grouping(Index([], dtype="int"), np.array([], dtype=np.intp)))

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
